    [],nt"revision_timestamp": "2013-03-15T21:27:34.381717",nt"name": "active-channel-for-fanno-creek-oregon",nt"isopen":
    false,nt"url": null,nt"notes": "Fanno Creek is a tributary to the Tualatin
    River and flows though parts of the southwest Portland metropolitan area. The stream
    is heavily influenced by urban runoff and shows characteristic flashy streamflow
    and poor water quality commonly associated with urban streams. This data set represents
    the active, wetted channel as derived from light detection and ranging (LiDAR) data
    and aerial photographic imagery. The wetted channel boundary is equivalent to the
    extent of water observed during a 2-yr high flow event.",nt"license_title":
